import React from "react";

function InfoToolTip(props) {
  return (
    <div className={`popup popup_type_${props.name} ${props.isOpen ? 'popup_opened' : ''} popup_opened`}>
      <div className="popup__container">
        <img/>
        <p>edsfsdfsdfsdfwfsdfsdfsd</p>
        <button className="popup__button-close popup__button-close_type_edit-profile" onClick={props.isClose}> </button>
      </div>
    </div>
  );
}

export default InfoToolTip;
